function SchoolList(){}SchoolList.prototype.listenDelEvent=function(){$(".del-btn").click(function(){console.log("1");var t=this;acalert.alertConfirm({msg:"确定要删除此学校吗？",confirmCallback:function(){var o=$(t).attr("data-school-id");acajax.post({url:"/del_school/",data:{school_id:o},success:function(o){acalert.alertSuccess({msg:"删除成功！",confirmCallback:function(){window.location.reload()}})}})}})})},SchoolList.prototype.run=function(){this.listenDelEvent()},$(function(){(new SchoolList).run()});